    if(source == null)
        return null;
    Map<String,Object> properties = source.getProperties();
    if(properties == null)
        return null;
    Fields fields = new Fields(mappings);
    Map<String,Object> historyMapping = structures.get("_source");
    if(historyMapping == null)
        return null;
    Map<String,Object> historyProperties = historyMapping.getProperties();
    if(historyProperties == null)
        return null;
    Map<String,Object> diff = new HashMap<>();
    for(Map.Entry<String,Object> entry : historyProperties.entrySet()){
        if(!properties.containsKey(entry.getKey())){
            diff.put(entry.getKey(),entry.getValue());
        }
