public static int computeUTF8Size(final CharSequence str,final int index,final int len){
    int size = 0;
    int i = index;
    while(i < len){
        final char c = str.charAt(i);
        if((c & 0x80) == 0){
            size++;
            i++;
        }else if((c & 0xE0) == 0xC0){
            size++;
            i++;
        }else if((c & 0xF0) == 0xE0){
            size++;
            i++;
        }else if((c & 0xF8) == 0xF0){
            size++;
            i++;
        }else{
            throw new IllegalArgumentException("Invalid character: " + c);
        }
    }
    return size;
}

