    if (encCount > 0) {
        int bytesToWrite = Math.min(len, buf.length - count);
        System.arraycopy(buf, count, chars, 0, bytesToWrite);
        count += bytesToWrite;
        len -= bytesToWrite;
        if (bytesToWrite < buf.length) {
            buf[count] = (byte) b[off];
            count++;
        }
        if (bytesToWrite < len) {
            encodePendingBytes(true);
        }
    }
    while (len > 0) {
        int bytesToWrite = Math.min(len, buf.length - count);
        System.arraycopy(b, off, buf, count, bytesToWrite);
        count += bytesToWrite;
        len -= bytesToWrite;
        off += bytesToWrite;
        if (bytesToWrite < buf.length) {
            buf[count] = (byte) b[off];
            count++;
        }
        if (bytesToWrite < len) {
            encodePendingBytes(true);
        }
    }
}

