public static int writeTo(final DataOutput out,LinkedBuffer node) throws IOException {
    if (node == null) {
        throw new IllegalArgumentException("node cannot be null");
    }
    if (node.buffer == null) {
        throw new IllegalStateException("buffer is not allocated");
    }
    if (node.offset < 0) {
        throw new IllegalArgumentException("offset cannot be negative");
    }
    if (node.start < 0) {
        throw new IllegalArgumentException("start cannot be negative");
    }
    if (node.offset > node.buffer.length) {
        throw new IllegalArgumentException("offset is out of bounds");
    }
    if (node.start > node.offset) {
        throw new IllegalArgumentException("start is out of bounds");
    }
    if (node.start + node.length > node.buffer.length) {
        throw new IllegalArgumentException("length is out of bounds");
    }
    if (node.next != null) {
        throw new IllegalStateException("next buffer is not null");
    }
    out.write(node.buffer,node.start,node.length);
    return node.length;
}

