    if(node == null)
        return false;
    if(node.getPrev() == node){
        node.getNext().setPrev(null);
    }else{
        node.getPrev().setNext(node.getNext());
        node.getNext().setPrev(node.getPrev());
    }
    node.setNext(null);
    node.setPrev(null);
    size--;
    return true;
}

