private String parseToken(final char[] terminators){
    final StringBuilder token = new StringBuilder();
    final Map<Character, Integer> charMap = new HashMap<>();
    for(pos = 0; pos < terminators.length; pos++){
        charMap.put(terminators[pos], pos);
    }
    while(true){
        if(hasChar()){
            chars[pos] = getChar();
            if(charMap.containsKey(chars[pos])){
                len = charMap.get(chars[pos]);
                if(len == 0){
                    break;
                }
                if(len > 0){
                    token.append(chars, 0, len);
                }
                if(len < 0){
                    token.append(chars, 0, -len);
                }
                pos += len;
            }else{
                token.append(chars, pos, 1);
                pos += 1;
            }
        }else{
            break;
        }
    }
    return token.toString();
}

