public void abbreviate(final int nameStart,final StringBuffer buf){
    if(nameStart<0){
        throw new IllegalArgumentException("nameStart must be greater than or equal to 0");
    }
    if(buf==null){
        throw new IllegalArgumentException("buffer must not be null");
    }
    if(fragments==null){
        throw new IllegalArgumentException("fragments must not be null");
    }
    int currentPos=nameStart;
    for(PatternAbbreviatorFragment fragment:fragments){
        if(currentPos+fragment.getCharCount()>buf.length()){
            throw new IllegalArgumentException("buffer size is smaller than the sum of the lengths of all fragments");
        }
        buf.delete(currentPos,currentPos+fragment.getCharCount());
        currentPos+=fragment.getCharCount();
        if(currentPos>=buf.length()){
            break;
        }
        buf.setCharAt(currentPos,fragment.getEllipsis());
        currentPos++;
    }
}

