public static List<ThreadSnapshot> parseFromFileWithTimeRange(File file,List<ProfileAnalyzeTimeRange> timeRanges) throws IOException {
    List<ThreadSnapshot> threadSnapshots = new ArrayList<>();
    try (FileInputStream fis = new FileInputStream(file);
         BufferedInputStream bis = new BufferedInputStream(fis)) {
        ThreadSnapshot threadSnapshot = new ThreadSnapshot();
        long lastEndTime = 0;
        for (ProfileAnalyzeTimeRange range : timeRanges) {
            long startTime = range.getStartTime();
            long endTime = range.getEndTime();
            if (startTime > endTime) {
                throw new IllegalArgumentException("Invalid time range: " + startTime + " > " + endTime);
            }
            long currentStartTime = lastEndTime;
            long currentEndTime = startTime;
            if (currentEndTime > endTime) {
                currentEndTime = endTime;
            }
            if (currentStartTime < endTime) {
                currentStartTime = startTime;
            }
            if (currentStartTime < lastEndTime) {
                throw new IllegalArgumentException("Invalid time range: " + currentStartTime + " > " + lastEndTime);
            }
            threadSnapshot.setStartTime(currentStartTime);
            threadSnapshot.setEndTime(currentEndTime);
            threadSnapshots.add(threadSnapshot);
            lastEndTime = currentEndTime;
        }
    }
    return threadSnapshots;
}
